import React from 'react';
import InputText from './InputText.js';
import Desplegable from './Desplegable.js';

function Formulario() {
        return (
            <div>
                <h1>Datos personales</h1>
                <form method="POST" action="index.php">
                    <InputText id="txtNombre" titulo="Nombre"/>
                    <InputText id="txtTelefono" titulo="Telefono" />
                    <InputText id="txtCorreo" titulo="Correo" />
                    <Desplegable id="lstPais" />
                    <button type="submit" class="my-5 btn-lg btn-primary">Enviar</button>
                </form >
            </div>
        );
}
export default Formulario;
